import React from "react";
import "./Nombre.scss";

const Nombre=()=>{
 return(
     <div className="contenedor-nombre">
         <ul>
         <li><input type="text" placeholder="Nombre"/></li>
         <li><input type="text" placeholder="Edad"/></li>
         <li><input type="text" placeholder="Peso"/></li>
         <li><button>Agregar</button></li>
         </ul>
     </div>
 )
}

export default Nombre;
